    [cnt_l, cnt_r, cnt_t, cnt_b] = [int(x) for x in stdin.split(' ')]

    candidates = set([(x1, y1, x2, y2) for x1, y1, x2, y2 in sofas])

    for x1, y1, x2, y2 in sofas:
        if y1 == y2:
            candidates.update([(x1, y1 - 1, x2, y1 - 1), (x2, y2 + 1, x1, y2 + 1)])
        elif x1 == x2:
            candidates.update([(x1 - 1, y1, x1 - 1, y2), (x2 + 1, y1, x2 + 1, y2)])

    def count(x1, y1, x2, y2):
        if x1 < x2 and (x1, y1, x2, y2) in candidates:
            return cnt_l
        elif x2 < x1 and (x1, y1, x2, y2) in candidates:
            return cnt_r
        elif y1 < y2 and (x1, y1, x2, y2) in candidates:
            return cnt_t
        elif y2 < y1 and (x1, y1, x2, y2) in candidates:
            return cnt_b
        else:
            return 0

    sol = 0
    for x1, y1, x2, y2 in sofas:
        sol += count(x1, y1, x2, y2)
    return sol if sol else -1

