class Node(object):

    def __init__(self, value):
        self.value = value
        self.next = None

class LinkedList(object):

    def __init__(self):
        self.head = None
        self.tail = None

    def add(self, value):
        newNode = Node(value)

        if self.head is None:
            self.head = newNode
            self.tail = newNode
            return

        if self.head.next is None:
            self.head.next = newNode
            self.tail = newNode
            return

        curr = self.head
        while(curr.next is not None):
            curr = curr.next

        curr.next = newNode
        self.tail = curr.next
        return

    def printLL(self):
        curr = self.head
        while(curr.next is not None):
            print(curr.value, "--> ", end="")
            curr = curr.next

        print(curr.value, "-->", end="")
        print(self.tail.value)
        return

    def listLen(self):
        if self.head is None:
            return 0

        if self.head.next is None:
            return 1

        curr = self.head
        counter = 0
        while(curr.next is not None):
            curr = curr.next
            counter += 1

        return counter + 1


