    lines = stdin.splitlines()
    n, m = map(int, lines[0].split())
    matrix = []
    for i in range(1, n + 1):
        matrix.append([char for char in lines[i]])
    def is_valid(matrix, n, m, r, c):
        if r < n and c < m:
            if matrix[r][c] == "w":
                for i in range(r, n):
                    if matrix[i][c] == "w":
                        return False
                for j in range(c, m):
                    if matrix[r][j] == "w":
                        return False
                return True
        return False
    def get_pixels(matrix, n, m):
        pixels = set()
        for r in range(n):
            for c in range(m):
                if matrix[r][c] == "w":
                    pixels.add((r, c))
        return pixels
    def bfs(matrix, n, m, target_pixels, target_size):
        queue = [(matrix, n, m, 1, 1, target_pixels, target_size)]
        while queue:
            matrix, n, m, level, r, c, target_size = queue.pop(0)
            if level > target_size:
                return []
            elif level == target_size:
                if is_valid(matrix, n, m, r, c):
                    return matrix
                else:
                    continue
            for dr, dc in ((0, 1), (1, 0), (0, -1), (-1, 0)):
                nr = r + dr
                nc = c + dc
                if (nr, nc) not in target_pixels and is_valid(matrix, n, m, nr, nc):
                    queue.append((
                        matrix, n, m, level + 1, nr, nc, target_size))
        return []
    all_pixels = get_pixels(matrix, n, m)
    min_size = min(n, m)
    for size in range(1, min_size + 1):
        pixels = bfs(matrix, n, m, all_pixels, size)
        if pixels:
            return pixels[0]
    return "0"

