В этой задаче вам предстоит дескриптор, который будет хранить количество чисел и их порядок в файле. Дескриптор должен поддерживать все операции «зашифровать» и «расшифровать» значения, на практике можно использовать модуль pickle или строковый метод строкового модуля. Однако дескриптор должен поддерживать возможность отслеживать порядок следования данных в файле, и данные должны отсортироваться при выводе и при записи из файла. К примеру, если вы хотите изменить список данных при записи в файл, вы должны использовать модуль pickle или можете обратиться к методу строкового модуля.

