def solution(stdin: str) -> str:
    s = stdin[0].split()[0]
    # firstly find the minimum number of changes required to transform s to a palindrome
    # by adding the minimum of the letters to the beginning and end of s
    # we get the minimum number of changes in the beginning and end of s
    min_num_changes = min(s.count(c) for c in set(s))
    # find the palindrome with the minimum number of changes to the left and right of s
    # left and right contain the minimum number of changes to transform s to palindrome
    # for each possible palindrome in s
    # we check if it is a palindrome and if it is we check if the number of changes to transform s to palindrome is smaller than in palindrome to the left and right
    # if palindrome to the left and right is smaller than current palindrome then palindrome to the left and right becomes current palindrome
    left, right = s, s
    for i in range(min_num_changes):
        left = left.replace(s[i], '')
        right = right.replace(s[len(s)-1-i], '')
    for left_palindrome in (s+left+s[::-1][1:min_num_changes+1]):
        left_num_changes = 0
        for i in range(len(s)):
            if s[i]!= left_palindrome[i]:
                left_num_changes += 1
        for right_palindrome in (s+right+s[::-1][1:min_num_changes+1]):
            right_num_changes = 0
            for i in range(len(s)):
                if s[i]!= right_palindrome[i]:
                    right_num_changes += 1
            if left_num_changes < right_num_changes:
                left = left_palindrome
                right = right_palindrome
                break
    return left + s[min_num_changes:len(s)-min_num_changes] + right

