def solution(stdin: str) -> str:
    """
    AUTHOR: Sajjad Hashemi

    The first line of input will contain two integers n and m (1 ≤ n, m ≤ 500), the dimensions of the puzzle piece.
    The next n lines will describe the jigsaw piece. Each line will have length m and will consist of characters '.' and 'X' only. 'X' corresponds to a part of the puzzle piece, '.' is an empty space.
    It is guaranteed that the 'X' characters form a 4-connected region.

    :param stdin:
    :return:
    """

    n, m = [int(i) for i in stdin.split('\n')[0].split()]
    puzzle = [input() for i in range(n)]
    visited = set()

    def dfs(x, y, a, b):
        if x > a or y > b or x < 0 or y < 0:
            return
        if puzzle[x][y] == 'X':
            return dfs(x + 1, y, a, b) or dfs(x, y + 1, a, b) or dfs(x - 1, y, a, b) or dfs(x, y - 1, a, b)
        elif (x, y) in visited:
            return
        elif puzzle[x][y] == '.':
            return False
        visited.add((x, y))
        return True

    for i in range(n):
        for j in range(m):
            if puzzle[i][j] == 'X':
                if dfs(i, j, n, m):
                    return 'YES'

    return 'NO'

def solution(stdin: str) -> str:
    '''
    We should be able to solve this by just trying every possible orientation.
    However, this is O(n^2) time. So instead, we can simply take the largest grid (in terms of rows) and check each of its four corners.
    '''
    n, m = [int(i) for i in stdin.split(' ')]
    grid = []
    for _ in range(n):
        grid.append(list(stdin.split('\n')[0]))

    max_rows = max([len(row) for row in grid])
    max_cols = max([len(grid) for grid in grid])

    grid = [row[0:max_cols] for row in grid[0:max_rows]]

    def find_rect(grid: list) -> bool:
        '''
        Given a grid, checks if a rectangle is possible.
        Returns True if it is, otherwise False.
        '''
        for row in grid:
            if 'X' not in row:
                continue
            else:
                return False

        # check verticals
        for row in grid:
            if 'X' not in [row[0], row[-1]]:
                continue
            else:
                return False

        # check diagnols
        if 'X' not in grid[0]:
            return False
        if 'X' not in [grid[i][i] for i in range(len(grid))]:
            return False
        if 'X' not in [grid[i][-1-i] for i in range(len(grid))]:
            return False

        return True

    for flip in range(2):
        for rot in range(4):
            for i in range(len(grid)):
                if flip:
                    grid[i] = grid[i][::-1]
                if rot:
                    grid[i] = grid[i][::-1]
                if find_rect(grid):
                    return 'YES'

    return 'NO'

