class Polynomial:
    def __init__(self, coef: List[int]):
        self.coefficients = coef

    def __repr__(self):
        return f'Polynomial({self.coefficients})'

    def __str__(self):
        return str(self.coefficients)

    def __eq__(self, other):
        return self.coefficients == other.coefficients

    def add_constant(self):
        if self.coefficients[0] == 0:
            self.coefficients = self.coefficients[1:]
        else:
            self.coefficients.insert(0, 0)

    def remove_zeros(self):
        for i in range(self.coefficients.count(0)):
            self.coefficients.remove(0)

    def reduce_polynoms(self):
        p = self.coefficients
        while len(p) > 1 and p[0] == 0:
            p = p[1:]
        while len(p) > 1 and p[-1] == 0:
            p = p[:-1]
        if len(p) == 1:
            return Polynomial(p)
        if p[0] == 0:
            p = p[1:]
        if p[-1] == 0:
            p = p[:-1]
        if len(p) == 1:
            return Polynomial(p)
        k = 1
        while k < len(p):
            if p[k] == p[k - 1]:
                p = p[:k - 1] + p[k + 1:]
            else:
                k += 1
        return Polynomial(p)


