def solution(stdin: str) -> str:
    n, m = map(int, stdin.split())
    leads = list(map(int, stdin.split()))

    def permutation(arr):
        n = len(arr)
        if n == 1:
            return [arr]
        else:
            return [arr[i:] + arr[:i] for i in range(n)]

    def is_valid(perm):
        leader_count = {}
        for num in perm:
            if num in leader_count:
                leader_count[num] += 1
            else:
                leader_count[num] = 1
        for key in leader_count:
            if leader_count[key] > leads[key - 1]:
                return False
        return True

    def backtrack(perm, leads):
        if len(perm) == n and is_valid(perm):
            return perm
        else:
            for i in range(1, n + 1):
                if i not in perm:
                    res = backtrack(perm + [i], leads)
                    if res is not None:
                        return res

    return backtrack([], leads)


