    '''
    The idea is to use dfs to find the maximum distance from any leaf to the root. 
    We will store the distance of each node in a dictionary.
    After that we will use this dictionary to find the maximum distance. 
    This maximum distance is equal to the maximum distance from any leaf to the root.

    After the distance is calculated from the leaves to the root, we will need to 
    find the path that brings us to this distance. 
    We will use a list and a visited dict to find this path.
    We will start from the leaf with the maximum distance, and will find all the parent 
    nodes that way, until we find the root, which is the last element in the path. 
    The path will be reversed after the end of the recursive call, since we started from 
    the leaf.

    Time complexity: O(V + E), where V - number of vertices and E - number of edges.
    Space complexity: O(V), where V - number of vertices.

    :param stdin: standard input string
    :return: None
    '''
    n = int(stdin)
    l = []
    d = {}
    for i in range(n):
        l.append(stdin.split())

    def dfs(node, parent):
        if d.get(node):
            return d[node]
        if parent == -1:
            d[node] = 0
            return 0
        d[node] = 1 + dfs(l[parent][0], l[parent][1])
        if d.get(l[parent][0]):
            d[node] += d[l[parent][0]]
        if d.get(l[parent][1]):
            d[node] += d[l[parent][1]]
        return d[node]

    for i in range(n):
        dfs(l[i][0], i)
        dfs(l[i][1], i)

    m = 0
    for i in d.values():
        if i > m:
            m = i

    def dfs_reverse(node, parent):
        if d.get(node):
            return d[node]
        if parent == -1:
            d[node] = 0
            return 0
        d[node] = 1 + dfs_reverse(l[parent][0], parent)
        if d.get(l[parent][0]):
            d[node] += d[l[parent][0]]
        if d.get(l[parent][1]):
            d[node] += d[l[parent][1]]
        return d[node]

    for i in range(n):
        dfs_reverse(l[i][0], i)
        dfs_reverse(l[i][1], i)

    m = 0
    for i in d.values():
        if i > m:
            m = i

    l = []
    for i in d.keys():
        if d[i] == m:
            l.append(i)

    l.sort()
    ans = []
